{{#data}}
<html>
  <head>
    <meta charset="UTF-8">
    <link rel="preconnect" href="https://fonts.googleapis.com">
    <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>
    {{{font}}}
    <style>
      @font-face {
        font-family: 'Noto Color Emoji';
        src: url(https://raw.githack.com/googlefonts/noto-emoji/main/fonts/NotoColorEmoji.ttf);
      }
      body{
        height: 100vh;
        margin: 0 !important;
        padding:0 !important;
        border:0 !important;
        outline:0 !important;
      }
      .break-after {
        page-break-after: always;
      }
      .page-break-avoid{
        page-break-inside: avoid;
      }
      .card-container{
        padding: 0;
        max-width: 700px;
        margin: auto;
      }
      .card-front{
        height: 100vh;
        position: relative;
      }
      .card-front-left{
        height: 100vh;
        position: relative;
        width: 50%;
        float: left;
      }
      .card-front-right{
        height: 100vh;
        position: relative;
        width: 50%;
        float: right;
        text-align: center;
        
      }
      .card-front-right-design{
        height: 100%;
        max-width: 100% !important;
      }
      .design{
        width: 100%;
        position: absolute;
        top: 0;
      }

      .card-back{
        position: relative;
        height: 100vh;
      }
      .card-back-left{
        height: 100vh;
        position: relative;
        width: 50%;
        float: left;
      }
      .card-back-right{
        height: 100vh;
        position: relative;
        width: 50%;
        float: right;
        /* margin-top: 10px; */
      }
      .message{
        position: absolute;
        top:0%;
        left: 0;
      }
      .message-inner{
        width: 250px !important;
        font-size: 14px !important;
        line-height: 20px;
        word-wrap:break-word !important;
      }
      #tmbwrap.word-break{
        /* text-align: justify; */
        word-wrap:break-word !important;
      }

      #tmbwrap.font{
        color: transparent;
        text-shadow: 0 0 0 blue;
      }

      .card-front-footer{
        position: absolute;
        bottom: -10px;
        text-align: center;
        width: 100%;
        text-align: center;
        font-family: AvenirNext;
        
      }
      .orderid{
        font-size: 20px;
        font-family: AvenirNext;
        /* color: #7d7d7d; */
        color:#232d7e
      }
      .logo{
        width: 100px;
      }
      .website{
        font-size: 8px;
        letter-spacing: 0.6px;
        font-family: AvenirNext;
      }
      .coupon{
        font-size: 8px;
        font-family: AvenirNext;
      }
      .footer-logo{
        width: 100px;
        margin: auto;
        background-repeat: no-repeat;
        background-size: 50px;
      }
      </style>
  </head>
